import React from 'react';

function StockList(){
	return (
   <ol> 
    {
    stocks.map((stock,index)=>{
      return  <li key={index}>
          <div >
              <span >{stock.stockname}</span>
              <span >{stock.price}</span>
          </div>
      </li>
    })
    }
    </ol>
	);
};

export default StockList;
